import React from "react";
import BackendAPI from "../API/BackendAPI.jsx";

export default function AuctionList(){
    let auctionList = BackendAPI.GetAllAuctions();

    return(
        <div key="auctionList">
            List
            <ul>
                {
                    auctionList.map((element, index) => {
                        {<li>
                            <p>{index}</p>
                           <p> {element["name"]}</p>
                        </li>}  
                      })
                }
            </ul>
            End
        </div>
    )
}
